const {Outlet, Navigate } = require("react-router");

const useAuth = () => {
    const user = {loggedIn: false};
    return user && user.loggedIn;
}

const PrivateRoutes = () => {
    const isAuth = useAuth();
    return isAuth ? <Outlet/> : <Navigate to="/"/>
};

export default PrivateRoutes;
